var tipuesearch = {"pages": [{'title': 'Call for Code', 'text': 'RedHat Openshift and Github Pages \n http://taiwan-no-1-git-heroku5-dev.apps.sandbox-m2.ll9k.p1.openshiftapps.com/content/index.html \n 將 Github Pages 的網站部署到  Heroku  與  RedHat Openshift \n 與上述 Openshift 上的網站同步: \n https://taiwan-no1.herokuapp.com \n https://heroku5.github.io/taiwan-no1 \n 三個雲端網站同步部署流程: \n \n 主要倉儲位於:  https://github.com/heroku5/taiwan-no1 \n 透過 Github Pages 設定完成:  https://heroku5.github.io/taiwan-no1 \n 透過 Heroku CLI 將近端倉儲在 Heroku 登入狀態下以  heroku git:remote -a taiwan-no1 設定 git remote add 後, 再透過 git push heroku 將資料同步至 Heroku 雲端主機  https://taiwan-no1.herokuapp.com   \n RedHad Openshift 部分則以 php app, 透過兩段網站跳轉, 從 index.php 跳至 index.html 再跳轉至靜態網站 content/index.html, 完成  http://taiwan-no-1-git-heroku5-dev.apps.sandbox-m2.ll9k.p1.openshiftapps.com/content/index.html \n \n \n', 'tags': '', 'url': 'Call for Code.html'}, {'title': 'Heroku', 'text': '本網站網址: \n https://heroku5.github.io/taiwan-no1 \n https://taiwan-no1.herokuapp.com \n 假如在命令列中輸入 heroku login -i 時出現: \n Error: getaddrinfo ENOTFOUND api.heroku.com api.heroku.com:443 問題 \n 請參見  https://github.com/heroku/cli/issues/1305', 'tags': '', 'url': 'Heroku.html'}]};